import { fork } from "redux-saga/effects";
import countWhatcher from "./sagaCount";

function* loggerSaga(action) {
    console.log(action);
    yield;
}

function* rootSaga() {
    fork(countWhatcher)
    fork(loggerSaga)
}

export default rootSaga;
